import React from 'react';
import Gallery from 'react-image-gallery';
import 'react-image-gallery/styles/css/image-gallery.css';

const ImageGalleryComponent = () => {
  const images = [
    {
      original: '/images/sembrado1.jpg',
      thumbnail: '/images/sembrado1_thumb.jpg',
    },
    {
      original: '/images/sembrado2.jpg',
      thumbnail: '/images/sembrado2_thumb.jpg',
    },
    {
      original: '/images/sembrado3.jpg',
      thumbnail: '/images/sembrado3_thumb.jpg',
    },
  ];

  return (
    <div className="gallery-container">
      <h2>Galer√≠a de Sembrados Inteligentes</h2>
      <Gallery items={images} />
    </div>
  );
};

export default ImageGalleryComponent;
